function Login() {
  return (
    <section>
      <h1>Login</h1>
      <div className="container">
        <div className="logo-container">
            <img src="https://www.entreprenerd.cl/wp-content/uploads/2022/03/Logo-Xepelin-JPG.jpg" alt="Xepelin Logo" ></img>
        </div> 
      </div>
    </section>
  );
}

export default Login;
